sys_variable_value.value:
(function paginate(variables, pageResponse) {
    gs.info("Next Token"+variables.NextToken);
    if(variables.NextToken == null || variables.NextToken == "null"  ){
        variables.getNextPage = false;
    }
    else variables.getNextPage = true;
})(variables, pageResponse);

