sys_variable_value.value:
(function execute(inputs, outputs) {
  if(inputs.next_token == null || inputs.next_token == "null" || inputs.next_token == ""){
  	outputs.next_token = "";
  }
  else{ outputs.next_token =  inputs.next_token};
})(inputs, outputs);

